import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import ProductoCard from '../../../components/ProductoCard';
import { cargarProductos } from '../../../services/productos';

// Datos simulados para series

// Datos de categor√≠as
const categorias = [
  {
    id: 1,
    nombre: 'Frutas y Verduras',
    imagen: 'data:image/jpeg;base64,',
    link: '/categorias/alimentos'
  },
  {
    id: 2,
    nombre: 'Bebidas',
    imagen: 'data:image/jpeg;base64,',
    link: '/categorias/bebidas'
  },
  {
    id: 3,
    nombre: 'Limpieza',
    imagen: 'data:image/jpeg;base64,',
    link: '/categorias/limpieza'
  },
  {
    id: 4,
    nombre: 'Congelados',
    imagen: 'data:image/jpeg;base64,',
    link: '/categorias/limpieza'
  }, 
  {
    id: 5,
    nombre: 'Despensa',
    imagen: 'data:image/jpeg;base64,',
    link: '/categorias/limpieza'
  },
  {
    id: 6,
    nombre: 'L√°cteos y Huevos',
    imagen: 'data:image/jpeg;base64,',
    link: '/categorias/limpieza'
  }
];

const Inicio = () => {
  const [busqueda, setBusqueda] = useState('');
  const [productosMasVendidos, setProductosMasVendidos] = useState([]);
  const [productosNuevos, setProductosNuevos] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const cargarProductosInicio = async () => {
      try {
        setLoading(true);
        const productos = await cargarProductos();
        
        // Tomar los primeros 12 productos para m√°s vendidos
        setProductosMasVendidos(productos.slice(0, 12));
        
        // Tomar los √∫ltimos 6 productos para nuevos
        setProductosNuevos(productos.slice(-6));
      } catch (error) {
        console.error('Error al cargar productos:', error);
      } finally {
        setLoading(false);
      }
    };

    cargarProductosInicio();
  }, []);

  const handleBuscar = (e) => {
    e.preventDefault();
    if (busqueda.trim() !== '') {
      navigate(`/busqueda?q=${encodeURIComponent(busqueda)}`);
    }
  };

  if (loading) {
    return <div className="loading">Cargando productos...</div>;
  }

  return (
    <div className="container mx-auto px-4 py-8">
      {/* Banner publicitario */}
      <div className="mb-8">
        <img src="https://wongio.vtexassets.com/assets/vtex.file-manager-graphql/images/3fde921c-5886-40cc-914e-72ed2486217d___0651bafcf80275428fa83b06310b42b6.jpg" alt="Banner" className="w-full rounded-lg shadow" />
      </div>

      {/* Barra de b√∫squeda */}
      <form onSubmit={handleBuscar} className="flex justify-center mb-8">
        <input
          type="text"
          placeholder="Buscar productos, series o marcas..."
          value={busqueda}
          onChange={(e) => setBusqueda(e.target.value)}
          className="w-1/2 p-2 border border-gray-300 rounded-l focus:outline-none"
        />
        <button type="submit" className="bg-[#FE624C] text-white px-4 rounded-r">Buscar</button>
      </form>

      {/* Categor√≠as destacadas */}
      <div className="bg-white rounded-lg shadow-md p-6">
        <h2 className="text-2xl font-semibold mb-6 text-center">Categor√≠as Destacadas</h2>
        <div className="flex flex-row justify-between gap-6">
          {categorias.map((categoria) => (
            <Link 
              key={categoria.id} 
              to={categoria.link} 
              className="flex flex-col items-center gap-2 p-3 rounded-lg hover:bg-gray-50 transition-colors"
            >
              <div className="relative">
                <div className="w-16 h-16 rounded-full overflow-hidden border-2 border-[#FE624C]">
                  <img 
                    src={categoria.imagen} 
                    alt={categoria.nombre} 
                    className="w-full h-full object-cover"
                  />
                </div>
                <div className="absolute -bottom-1 -right-1 w-4 h-4 bg-[#FE624C] rounded-full"></div>
              </div>
              <span className="text-lg font-medium text-gray-800">{categoria.nombre}</span>
            </Link>
          ))}
        </div>
      </div>
      {/* Productos m√°s vendidos */}
      <div className="mb-12">
        <h2 className="text-2xl font-bold mb-4 text-center">Los 12 m√°s vendidos del mes</h2>
        <div className="grid grid-cols-2 md:grid-cols-4 lg:grid-cols-6 gap-6">
          {productosMasVendidos.map((producto) => (
            <ProductoCard key={producto.id} producto={producto} />
          ))}
        </div>
      </div>

      {/* Productos nuevos */}
      <div className="mb-12">
        <h2 className="text-2xl font-bold mb-4 text-center">Productos Nuevos</h2>
        <div className="grid grid-cols-2 md:grid-cols-3 gap-6">
          {productosNuevos.map((producto) => (
            <ProductoCard key={producto.id} producto={producto} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default Inicio;
